{
  "ubx_message": {
    "name": "UBX-CFG-NAV5",
    "description": "Navigation engine settings",
    "message_type": "get_set",
    "class_id": "0x06",
    "message_id": "0x24",
    "payload_length": {
      "fixed": 36
    },
    "firmware_support": [
      "15",
      "15.01",
      "16",
      "17",
      "18",
      "19",
      "19.1",
      "19.2",
      "20",
      "20.01",
      "20.1",
      "20.2",
      "20.3",
      "22",
      "22.01",
      "23",
      "23.01"
    ],
    "fields": [
      {
        "byte_offset": 0,
        "name": "mask",
        "data_type": "X2",
        "description": "Parameters bitmask. Only the masked parameters will be applied. (see graphic below)"
      },
      {
        "byte_offset": 2,
        "name": "dynModel",
        "data_type": "U1",
        "description": "Dynamic platform model: 0: portable, 2: stationary, 3: pedestrian, 4: automotive, 5: sea, 6: airborne with <1g acceleration, 7: airborne with <2g acceleration, 8: airborne with <4g acceleration, 9: wrist-worn watch (not supported in protocol versions less than 18), 10: bike (supported in protocol versions 19.2)"
      },
      {
        "byte_offset": 3,
        "name": "fixMode",
        "data_type": "U1",
        "description": "Position fixing mode: 1: 2D only, 2: 3D only, 3: auto 2D/3D"
      },
      {
        "byte_offset": 4,
        "name": "fixedAlt",
        "data_type": "I4",
        "scale": {
          "raw": "0.01",
          "multiplier": 0.01
        },
        "unit": "m",
        "description": "Fixed altitude (mean sea level) for 2D fix mode"
      },
      {
        "byte_offset": 8,
        "name": "fixedAltVar",
        "data_type": "U4",
        "scale": {
          "raw": "0.0001",
          "multiplier": 0.0001
        },
        "unit": "m^2",
        "description": "Fixed altitude variance for 2D mode"
      },
      {
        "byte_offset": 12,
        "name": "minElev",
        "data_type": "I1",
        "unit": "deg",
        "description": "Minimum elevation for a GNSS satellite to be used in NAV"
      },
      {
        "byte_offset": 13,
        "name": "drLimit",
        "data_type": "U1",
        "unit": "s",
        "description": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 14,
        "name": "pDop",
        "data_type": "U2",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "description": "Position DOP mask to use"
      },
      {
        "byte_offset": 16,
        "name": "tDop",
        "data_type": "U2",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "description": "Time DOP mask to use"
      },
      {
        "byte_offset": 18,
        "name": "pAcc",
        "data_type": "U2",
        "unit": "m",
        "description": "Position accuracy mask"
      },
      {
        "byte_offset": 20,
        "name": "tAcc",
        "data_type": "U2",
        "unit": "m",
        "description": "Time accuracy mask"
      },
      {
        "byte_offset": 22,
        "name": "staticHoldThresh",
        "data_type": "U1",
        "unit": "cm/s",
        "description": "Static hold threshold"
      },
      {
        "byte_offset": 23,
        "name": "dgnssTimeout",
        "data_type": "U1",
        "unit": "S",
        "description": "DGNSS timeout"
      },
      {
        "byte_offset": 24,
        "name": "cnoThreshNumSVs",
        "data_type": "U1",
        "description": "Number of satellites required to have C/NO above cnoThresh for a fix to be attempted"
      },
      {
        "byte_offset": 25,
        "name": "cnoThresh",
        "data_type": "U1",
        "unit": "dBHz",
        "description": "C/NO threshold for deciding whether to attempt a fix"
      },
      {
        "byte_offset": 26,
        "name": "reserved1",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 28,
        "name": "staticHoldMaxDist",
        "data_type": "U2",
        "unit": "m",
        "description": "Static hold distance threshold (before quitting static hold)"
      },
      {
        "byte_offset": 30,
        "name": "utcStandard",
        "data_type": "U1",
        "description": "UTC standard to be used (see GNSS time bases): 0: Automatic; receiver selects based on GNSS configuration, 3: UTC as operated by the U.S. Naval Observatory (USNO); derived from GPS time, 5: UTC as combined from multiple European laboratories; derived from Galileo time, 6: UTC as operated by the former Soviet Union (SU); derived from GLONASS time, 7: UTC as operated by the National Time Service Center (NTSC), China; derived from BeiDou time (not supported in protocol versions less than 16)."
      },
      {
        "byte_offset": 31,
        "name": "reserved2",
        "data_type": {
          "array_of": "U1",
          "count": 5
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}
